INSERT INTO `cgu_accueil` (`ID`, `ID_type`, `date`, `contenu`) VALUES
(1, 1, '2018-06-25', '<h2>ARTICLE 1 : Objet </h2>\r\n        <p>Les présentes « conditions générales d\'utilisation » ont pour objet l\'encadrement juridique des modalités de mise à disposition des services du site www.domisep.com et leur utilisation par « l\'Utilisateur ». </br>\r\n        Les conditions générales d\'utilisation doivent être acceptées par tout Utilisateur souhaitant accéder au site. Elles constituent le contrat entre le site et l\'Utilisateur. L’accès au site par l’Utilisateur signifie son acceptation des présentes conditions générales d’utilisation. </br>\r\n        Éventuellement : </br>\r\n        En cas de non-acceptation des conditions générales d\'utilisation stipulées dans le présent contrat, l\'Utilisateur se doit de renoncer à l\'accès des services proposés par le site. </br>\r\n            www.domisep.com se réserve le droit de modifier unilatéralement et à tout moment le contenu des présentes conditions générales d\'utilisation. </br></p>\r\n\r\n        <h2>ARTICLE 2 : Mentions légales</h2>\r\n        <p>L\'édition du site www.Domisep.com est assurée par la Société Domisep SAS au capital de 35 000 000 € dont le siège social est situé au 28, Rue Notre-Dame des Champs. </br>\r\n        Le Directeur de la publication est M. Nicolas LEBORGNE.\r\n        L\'hébergeur du site www.domisep.com est la Société OVH SAS au capital de 10 174 560,00 € dont le siège social est situé au 2, Rue Kellermann, 59100 Roubaix. </br></p>\r\n\r\n        <h2>ARTICLE 3 : Définitions</h2>\r\n        <p>La présente clause a pour objet de définir les différents termes essentiels du contrat : </br>\r\n        Utilisateur : ce terme désigne toute personne qui utilise le site ou l\'un des services proposés par le site. </br>\r\n        Contenu utilisateur : ce sont les données transmises par l\'Utilisateur au sein du site. </br>\r\n        Membre : l\'Utilisateur devient membre lorsqu\'il est identifié sur le site. </br>\r\n        Identifiant et mot de passe : c\'est l\'ensemble des informations nécessaires à l\'identification d\'un Utilisateur sur le site. L\'identifiant et le mot de passe permettent à l\'Utilisateur d\'accéder à des services réservés aux membres du site. Le mot de passe est confidentiel. </br>\r\n        </p>\r\n\r\n        <h2>ARTICLE 4 : accès aux services</h2>\r\n        <p>Le site permet à l\'Utilisateur un accès gratuit, s’il dispose du matériel de domotique Domisep prévu à cet effet, aux services suivants :</br>\r\n        - Statistiques de consommation énergétique ; </br>\r\n        - Pilotage du domicile ; </br>\r\n        - Ajout de membres disposant de droits de gestion sur le domicile ; </br>\r\n        - Gérer, le cas échéant, plusieurs domiciles ; </br>\r\n        - Contacter Domisep. </br>\r\n        Le site est accessible gratuitement en tout lieu à tout Utilisateur ayant un accès à Internet. Tous les frais supportés par l\'Utilisateur pour accéder au service (matériel informatique, logiciels, connexion Internet, etc.) sont à sa charge. </br>\r\n        Selon le cas :\r\n        L’Utilisateur non membre n\'a pas accès aux services réservés aux membres. Pour cela, il doit s\'identifier à l\'aide de son identifiant et de son mot de passe.\r\n        Le site Internet met en œuvre tous les moyens mis à sa disposition pour assurer un accès de qualité à ses services. L\'obligation étant de moyens, le site ne s\'engage pas à atteindre ce résultat.\r\n        Tout événement dû à un cas de force majeure ayant pour conséquence un dysfonctionnement du réseau ou du serveur n\'engage pas la responsabilité de www.domisep.com.\r\n        L\'accès aux services du site Internet peut à tout moment faire l\'objet d\'une interruption, d\'une suspension, d\'une modification sans préavis pour une maintenance ou pour tout autre cas. L\'Utilisateur s\'oblige à ne réclamer aucune indemnisation suite à l\'interruption, à la suspension ou à la modification du présent contrat. </br>\r\n            L\'Utilisateur a la possibilité de contacter le site par messagerie électronique à l’adresse contact@accueil_domisep.com. </br></p>\r\n\r\n        <h2>ARTICLE 5 : Propriété intellectuelle</h2>\r\n        <p>Les marques, logos, signes et tout autre contenu du site font l\'objet d\'une protection par le Code de la propriété intellectuelle et plus particulièrement par le droit d\'auteur. </br>\r\n        L\'Utilisateur sollicite l\'autorisation préalable du site pour toute reproduction, publication, copie des différents contenus. </br>\r\n        L\'Utilisateur s\'engage à une utilisation des contenus du site dans un cadre strictement privé. Une utilisation des contenus à des fins commerciales est strictement interdite. </br>\r\n        Tout contenu mis en ligne par l\'Utilisateur est de sa seule responsabilité. L\'Utilisateur s\'engage à ne pas mettre en ligne de contenus pouvant porter atteinte aux intérêts de tierces personnes. Tout recours en justice engagé par un tiers lésé contre le site sera pris en charge par l\'Utilisateur. </br>\r\n        Le contenu de l\'Utilisateur peut être à tout moment et pour n\'importe quelle raison supprimer ou modifier par le site. L\'Utilisateur ne reçoit aucune justification et notification préalablement à la suppression ou à la modification du contenu Utilisateur. </br>\r\n        </p>\r\n\r\n        <h2>ARTICLE 6 : Données personnelles</h2>\r\n        <p>Les informations demandées à l’inscription au site sont nécessaires et obligatoires pour la création du compte de l\'Utilisateur. En particulier, l\'adresse électronique pourra être utilisée par le site pour l\'administration, la gestion et l\'animation du service. </br>\r\n        Le site assure à l\'Utilisateur une collecte et un traitement d\'informations personnelles dans le respect de la vie privée conformément à la loi n°78-17 du 6 janvier 1978 relative à l\'informatique, aux fichiers et aux libertés. Le site est déclaré à la CNIL sous le numéro 01 49 54 52 43. </br>\r\n        En vertu des articles 15, 16, 17, 20 et 21 du Régime Général de Protection des Données du 25 mai 2018, l\'Utilisateur dispose d\'un droit d\'accès, de rectification, de suppression, de portabilité et d\'opposition de ses données personnelles. L\'Utilisateur exerce ce droit via : </br>\r\n        - son espace personnel ; </br>\r\n        - un formulaire de contact ; </br>\r\n        - par mail à contact@donnees_domisep.com ; </br>\r\n            - par voie postale au 2, Rue Kellermann, 59100 Roubaix. </br></p>\r\n\r\n        <h2>ARTICLE 7 : Responsabilité et force majeure</h2>\r\n        <p>Les sources des informations diffusées sur le site Internet sont réputées fiables. Toutefois, le site Internet se réserve la faculté d\'une non-garantie de la fiabilité des sources. Les informations données sur le site Internet le sont à titre purement informatif. Ainsi, l\'Utilisateur assume seul l\'entière responsabilité de l\'utilisation des informations et contenus du présent site Internet. </br>\r\n        L\'Utilisateur s\'assure de garder son mot de passe secret. Toute divulgation du mot de passe, quelle que soit sa forme, est interdite.</br>\r\n        L\'Utilisateur assume les risques liés à l\'utilisation de son identifiant et mot de passe. Le site Internet décline toute responsabilité. </br>\r\n        Tout usage du service par l\'Utilisateur ayant directement ou indirectement pour conséquence des dommages doit faire l\'objet d\'une indemnisation au profit du site Internet. </br>\r\n        Une garantie optimale de la sécurité et de la confidentialité des données transmises n\'est pas assurée par le site Internet. Toutefois, le site Internet s\'engage à mettre en œuvre tous les moyens nécessaires afin de garantir au mieux la sécurité et la confidentialité des données. </br>\r\n            La responsabilité du site Internet ne peut être engagée en cas de force majeure ou du fait imprévisible et insurmontable d\'un tiers. </br></p>\r\n\r\n        <h2>ARTICLE 8 : Liens hypertextes</h2>\r\n            <p>De nombreux liens hypertextes sortants sont présents sur le site Internet, cependant les pages web où mènent ces liens n\'engagent en rien la responsabilité de www.domisep.com qui n\'a pas le contrôle de ces liens. </br>\r\n                L\'Utilisateur s\'interdit donc à engager la responsabilité du site concernant le contenu et les ressources relatives à ces liens hypertextes sortants.</br></p>\r\n\r\n        <h2>ARTICLE 9 : Évolution du contrat</h2>\r\n            <p>Le site se réserve à tout moment le droit de modifier les clauses stipulées dans le présent contrat. </br></p>\r\n\r\n        <h2>ARTICLE 10 : Durée</h2>\r\n            <p>La durée du présent contrat est indéterminée. Le contrat produit ses effets à l\'égard de l\'Utilisateur à compter de l\'utilisation du service. </br></p>\r\n\r\n        <h2>ARTICLE 11 : Droit applicable et juridiction compétente</h2>\r\n            <p>La législation française s\'applique au présent contrat. En cas d\'absence de résolution amiable d\'un litige né entre les parties, seuls les tribunaux du ressort de la Cour d\'appel de la ville de Paris sont compétents. </br></p>\r\n\r\n        <h2>ARTICLE 12 : Publication par l’Utilisateur</h2>\r\n            <p>Le site permet aux membres de publier des messages et commentaires personnels. </br>\r\n            Dans ses publications, le membre s’engage à respecter les règles de la Netiquette et les règles de droit en vigueur. </br>\r\n            Le membre reste titulaire de l’intégralité de ses droits de propriété intellectuelle. </br>\r\n            Mais en publiant une publication sur le site, il cède à la société éditrice le droit non exclusif et gratuit de représenter, reproduire, adapter, modifier, diffuser et distribuer sa publication, directement ou par un tiers autorisé, dans le monde entier, sur tout support (numérique ou physique), pour la durée de la propriété intellectuelle. </br>\r\n            Le Membre cède notamment le droit d\'utiliser sa publication s